import React from 'react'
import { connect } from 'react-redux';

const CurrentBrandItem = (props) => {
    return(
      <div>
        {props.currentTradePavilion.brand.name}
      </div>
    )
}

export default connect(
  state => ({
    currentTradePavilion: state.brands.currentTradePavilion,
  })
)(CurrentBrandItem);
